import React from "react";
import {Link} from 'react-router-dom';
import background from "../assets/background.png";

function Welcome ({}) {
    return (
        <div className = "welcome-container">
            <div class="bg-img bg-cover" style="background-image: url('https://images.pexels.com/photos/14115170/pexels-photo-14115170.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1'); height:100%; width:100%;"></div>
            <Link to='/tdee_calculator'><button>Get Started Today!</button></Link>
        </div>
    )
}

export default Welcome;

